    return (
      <div>
        <div class="split left">
          <div className="centered">
            <img 
              className="my_image"
              alt="Profile Pic"
              ></img>
          </div>
        </div>
        <h1>About Me</h1>
        <img className = "profile_image" alt="Profile Pic">my_image</img>
        <h2>Introduction</h2>
        <p>I am a rising junior attending the University of Virginia.</p>
        <h2>Interests</h2>
        <p>I am interested in...</p>
      </div>
    )
  }
}
